import React from 'react';

class App extends React.Component {
// class App extends React.Component {
//     constructor(props: any) {
//         super(props);
//
//         this.state = {
//             loading: true,
//             matchLines: ''
//         };
//     }
    state = {
        // loading: false,
        matchLines: '',
    };

    // loading = (loading: boolean) => {
    //     this.setState({'loading': loading});
    //     console.log(this.state);
    // }

    setMatchLines = (data: string) => {
        //this.setState({'matchLines': data});

        var lines = data.split('\n');

        var matchLines = [];

        for (var line = 0; line < lines.length; line++) {
            let currentLine = lines[line].substring(24);
            let isPlayer = currentLine.includes('STEAM_');

            if (!isPlayer) {
                continue;
            }

            console.log(currentLine);
            matchLines.push({
                'isPlayer': isPlayer,
                'type': 'type..',
                'line': currentLine,
            });
        }
    }

    renderMatch() {
        console.log('renderMatch');
        const file = require("./matchdata/match.txt");

        fetch(file)
            .then((response) => response.text())
            .then((data) => {
                console.log(data);
                this.setMatchLines(data);
            });
    }

    componentDidMount() {
        this.renderMatch();
    }

    render() {
        return (
            <ul>
              { this.state.matchLines }
            </ul>
        );
    }
}

export default App;
